import React, { Component } from "react";

export default class Form extends Component {
    handleSubmit = (evt) => {
        evt.preventDefault();
    };
    render() {
        return ( <
            form onSubmit = { this.handleSubmit } >
            <
            input type = "text"
            onChange = { this.handleChange }
            required / >
            <
            button type = "submit" > Submit < /button> <
            /form>
        );
    }
}
